▪️⠀⠀⠀⠀⠀⠀⠀⠀⠀
L’exploitation du sel est ancienne dans le village de Salin-de-Giraud. Mais c’est à la fin du 19ème siècle que le village de Salin-de-giraud s’est développé près de l’embouchure du grand Rhône.⠀⠀⠀⠀⠀⠀⠀⠀⠀
▪️⠀⠀⠀⠀⠀⠀⠀⠀⠀
