Una nariz atractiva se mueve a la perfección al paladar de mora madura, cereza polvorienta y vainilla. Este vino está bien elaborado perfectamente madurado y concentrado sin exagerar, tiene una sensación jugoso y persistente  en boca.

El Pinot Noir es un vino de maridaje bastante versátil debido a que posee una ácidez alta y un nivel de taninos medio-bajo. En su aroma se distinguen tonos frutales y de especias -dejando entrever algunos terrosos y cercanos a la madera-, otorgándole la riqueza de matices que lo convierten en el compañero ideal de sabores delicados como:

Pescado.

Pollo.

Pato.

Hongos y setas.

Quesos suaves.

Siempre es bueno servirlo a una temperatura de 14º luego de que se oxigene como es debido y durante el tiempo que sea necesario. Respecto a la copa🍷 es recomendable utilizar una ancha en la parte inferior -para oxigenar- y amplia en la parte superior para que la bebida pase directamente a los costados de la lengua, que es donde sentimos la ácidez.

Hoy es un excelente día para disfrutar y Catar vino en casa….que vino vas a probar hoy?

